import React, { Component } from 'react';
import DogSpan from "./DogSpan"
import './App.css';

export default class App extends Component{

  listDogs = () => {

    fetch("http://localhost:3000/pups")
    .then(resp => resp.json())
    .then(dogs => {
      console.log(dogs)
      dogs.forEach(dog=> {
     return   <DogSpan doggy={dog} />
      })
    })
  }

render() {
  return (
    <div className="App">
      <div id="filter-div">
        <button id="good-dog-filter">Filter good dogs: OFF</button>
      </div>
      <div id="dog-bar">
       {this.listDogs}
      </div>
      <div id="dog-summary-container">
        <h1>DOGGO:</h1>
        <div id="dog-info">

        </div>
      </div>
    </div>
  );
}
}
